from lista import Lista
class Producto:
    def __init__(self, codigo, tipo, marca, modelo, precio, cantidad_stock):
        self.codigo = codigo
        self.tipo = tipo
        self.marca = marca
        self.modelo = modelo
        self.precio = precio
        self.cantidad_stock = cantidad_stock

    def __repr__(self):
        texto = '-'*80
        texto += '\n\n'
        texto += 'PRODUCTO:  {:65.65}'.format(self.modelo)
        texto += '\nMARCA:     {:15.15}'.format(self.marca)
        texto += '\nCATEGORIA: {:25}'.format(self.tipo)
        texto += '\nPRECIO:    US$ {}'.format(self.precio)
        texto += '\nSTOCK:     {}'.format(self.cantidad_stock)
        texto += '\n'
        texto += '-'*80
        texto += '\nCODIGO:    {}'.format(self.codigo)
        texto += '\n'
        texto += '-'*80
        return texto

